import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as r,d as h}from"./app-2f792065.js";const d={},t=h('<h1 id="考えられる問題と解決策" tabindex="-1"><a class="header-anchor" href="#考えられる問題と解決策" aria-hidden="true">#</a> 考えられる問題と解決策</h1><h2 id="なぜ私のファイルは正常に認識されなかったのか" tabindex="-1"><a class="header-anchor" href="#なぜ私のファイルは正常に認識されなかったのか" aria-hidden="true">#</a> なぜ私のファイルは正常に認識されなかったのか</h2><p>ファイルの命名は、特殊記号、スペースなど、認識されにくいファイル名は避けるべきです。できるだけ純粋な英語で命名してください。ファイルの拡張子はすべて小文字でなければなりません。</p><h2 id="なぜ私のオーディオファイルは正常に再生されなかったのか" tabindex="-1"><a class="header-anchor" href="#なぜ私のオーディオファイルは正常に再生されなかったのか" aria-hidden="true">#</a> なぜ私のオーディオファイルは正常に再生されなかったのか</h2><p>アップルブラウザでは、ogg ファイルの再生はサポートされていません。ファイル形式を変換する必要があります。例えば、mp3 に変換します。</p><h2 id="エクスポートされたウェブページがなぜ開けないのか" tabindex="-1"><a class="header-anchor" href="#エクスポートされたウェブページがなぜ開けないのか" aria-hidden="true">#</a> エクスポートされたウェブページがなぜ開けないのか</h2><p>ブラウザのセキュリティポリシーにより、ファイルからローカルウェブページを開くことはできません。http サーバーを使用し、WebGAL をウェブサイトをデプロイする方法に従ってデプロイする必要があります。一般的なものには、Nginx、Apache http サーバー、VS Code Live Server プラグイン、Python http サーバーがあります。</p><h2 id="windows-7-でなぜビジュアルエディタが一瞬で消えてしまうのか" tabindex="-1"><a class="header-anchor" href="#windows-7-でなぜビジュアルエディタが一瞬で消えてしまうのか" aria-hidden="true">#</a> Windows 7 でなぜビジュアルエディタが一瞬で消えてしまうのか</h2><p>node.js のバージョンが Windows 7 でサポートされている最高バージョンよりも高いためです。<a href="./win7">Windows 7 でビジュアルエディタを使用して制作を開始する方法</a> を参照して解決してください。</p>',9),i=[t];function n(o,s){return a(),r("div",null,i)}const f=e(d,[["render",n],["__file","faq.html.vue"]]);export{f as default};
